    private static Map<String, Double> validTableIdAvgMap;

    private static Map<String, Integer> validTableIdIndexMap;

    private static Map<String, Integer> patientIndexMap;

    private static double[][] result;

    private static Map<String, Integer> countPatient(String fileName) throws IOException {
        Map<String, Integer> patientIndexMap = new HashMap<>();
        BufferedReader bufferedReader = new BufferedReader(new FileReader(fileName));
        bufferedReader.readLine();
        String line;
        while ((line = bufferedReader.readLine()) != null) {
            patientIndexMap.put(line.split(",")[0], patientIndexMap.size());
        }
        bufferedReader.close();
        return patientIndexMap;
    }

    private static Map<String, Double> getValidTableIdAvgMap(String validTableIdSetJsonString) {
        Map<String, Map<String, Double>> map =
                JSON.parseObject(validTableIdSetJsonString, new TypeReference<Map<String, Map<String, Double>>>() {
                });
        return map.entrySet().stream().collect(Collectors.toMap(
                Map.Entry::getKey,
                e -> e.getValue().get("value"))
        );
    }

    private static Map<String, Integer> getValidTableIdIndexMap(Map<String, Double> validTableIdAvgMap) {
        List<String> validTableIdList = new ArrayList<>(new TreeSet<>(validTableIdAvgMap.keySet()));
        Map<String, Integer> result = new HashMap<>();
        for (int i = 0; i < validTableIdList.size(); ++i) {
            result.put(validTableIdList.get(i), i);
        }
        return result;
    }

    private static double[][] initResult(int row, int col) {
        double[][] result = new double[row][col];
        for (int i = 0; i < result.length; ++i) {
            for (int j = 0; j < result[0].length; ++j) {
                result[i][j] = -1;
            }
        }
        return result;
    }

    private static void fillResult(String fileName, Map<String, Double> validTableIdAvgMap,
                                   Map<String, Integer> validTableIdIndexMap, Map<String, Integer> patientIndexMap,
                                   double[][] result) throws IOException {
        BufferedReader bufferedReader = new BufferedReader(new FileReader(fileName));
        bufferedReader.readLine();
        String line;
        while ((line = bufferedReader.readLine()) != null) {
            String[] split = line.split(",");
            String vid = split[0];
            if (!patientIndexMap.keySet().contains(vid)) {
                continue;
            }
            String tableId = split[1];
            String results = split.length >= 3 ? split[2] : "";
            results = DataReader.replaceResults(results);
            if (validTableIdIndexMap.keySet().contains(tableId)) {
                result[patientIndexMap.get(vid)][validTableIdIndexMap.get(tableId)] =
                        results.isEmpty() ?
                                validTableIdAvgMap.getOrDefault(tableId, 0.0) :
                                Double.valueOf(results);
            }
        }
        bufferedReader.close();
        validTableIdAvgMap.forEach((tableId, avg) -> {
            Integer tableIdIndex = validTableIdIndexMap.get(tableId);
            for (int i = 0; i < result.length; ++i) {
                if (result[i][tableIdIndex] == -1) {
                    result[i][tableIdIndex] = avg;
                }
            }
        });
    }

